import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Navbar';
import PatientPage from './PatientPage';
// Import other pages

const App = () => {
  return (
    <Router>
      <Navbar />
      {/* <Switch> */}
        <Route path="/patient">
          <PatientPage />
        </Route>
        {/* Define routes for other pages */}
        {/* ... */}
      {/* </Switch> */}
    </Router>
  );
};

export default App;
